import React, { useState, useEffect } from 'react';
import './Clients.css';

const Clients = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  // 客户logo数组
  const clientLogos = [
    {
      id: 1,
      name: "Client 1",
      image: "/images/c1.jpg",
      alt: "Client 1"
    },
    {
      id: 2,
      name: "Client 2", 
      image: "/images/c2.jpg",
      alt: "Client 2"
    },
    {
      id: 3,
      name: "Client 3",
      image: "/images/c3.jpg", 
      alt: "Client 3"
    },
    {
      id: 4,
      name: "Client 4",
      image: "/images/c4.jpg",
      alt: "Client 4"
    },
    {
      id: 5,
      name: "Client 5",
      image: "/images/c5.jpg",
      alt: "Client 5"
    },
    {
      id: 6,
      name: "Client 6",
      image: "/images/c6.jpg",
      alt: "Client 6"
    },
    {
      id: 7,
      name: "Client 7",
      image: "/images/c7.jpg",
      alt: "Client 7"
    },
    {
      id: 8,
      name: "Client 8",
      image: "/images/c8.jpg",
      alt: "Client 8"
    }
  ];

  // 自动播放效果
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prevIndex) => 
        prevIndex === clientLogos.length - 1 ? 0 : prevIndex + 1
      );
    }, 3000); // 每3秒切换一次

    return () => clearInterval(interval);
  }, [clientLogos.length]);

  // 手动控制
  const goToSlide = (index) => {
    setCurrentIndex(index);
  };

  const nextSlide = () => {
    setCurrentIndex(currentIndex === clientLogos.length - 1 ? 0 : currentIndex + 1);
  };

  const prevSlide = () => {
    setCurrentIndex(currentIndex === 0 ? clientLogos.length - 1 : currentIndex - 1);
  };

  return (
    <section className="clients section" id="clients">
      <div className="container">
        <h2 className="section-title">Clients</h2>
        <div className="section-line"></div>

        {/* 滚动播放区域 */}
        <div className="clients-carousel">
          <div className="carousel-wrapper">
            <div 
              className="clients-track"
              style={{ transform: `translateX(-${currentIndex * 100}%)` }}
            >
              {clientLogos.map((client, index) => (
                <div key={client.id} className="client-slide">
                  <div className="clients-row">
                    {/* 显示当前slide的3个logo，循环显示 */}
                    {[0, 1, 2].map((offset) => {
                      const logoIndex = (index + offset) % clientLogos.length;
                      const logo = clientLogos[logoIndex];
                      return (
                        <div key={`${index}-${offset}`} className="client-logo">
                          <img
                            src={logo.image}
                            alt={logo.alt}
                            onError={(e) => {
                              e.target.style.display = 'none';
                              e.target.parentElement.style.backgroundColor = '#D9D9D9';
                            }}
                          />
                        </div>
                      );
                    })}
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* 控制按钮 */}
          <button className="carousel-control prev" onClick={prevSlide}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none">
              <path d="M15 18L9 12L15 6" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          </button>
          <button className="carousel-control next" onClick={nextSlide}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none">
              <path d="M9 18L15 12L9 6" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          </button>

          {/* 指示器 */}
          <div className="carousel-indicators">
            {clientLogos.map((_, index) => (
              <button
                key={index}
                className={`indicator ${index === currentIndex ? 'active' : ''}`}
                onClick={() => goToSlide(index)}
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Clients;
